import React from 'react'
// import {Box} from "@material-ui/core"
import {Button, Box} from '@mui/material'

const CartWidget = () => {
  return (
    <div>
        <Button style={{width:10}}>
        <img src={require('./carrito.png')} alt={'carrito'} style={{scale:'6%' }}></img>
        </Button>
    </div>
  )
}

export default CartWidget
